import { propTypes } from 'react';

export default function Card({ label, title, picture }) {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', padding: 15 }}>
      <span>{label}</span>
      <img src={picture} alt='freelance' heigh={80} width={80} />
      <span>{title}</span>
    </div>
  );
}

Card.propTypes = {
  Label: PropTypes.string,
};
